import React from "react";
import logo from "../resources/logo192.png";
// import logo from "../resources/react-logo.svg";

const ReactLogo = () => {
  return (
    <img src={logo} className="react-logo react-logo-drop-shadow" alt="logo" />
  );
};

export default ReactLogo;
